export default class {
    constructor(time) {
        this.time = time;
        this.onStartFn = null;
        this.onEndFn = null;
    }

    onStart(fn) {
        this.onStartFn = fn;
        return this;
    }

    onEnd(fn) {
        this.onEndFN = fn;
        return this;
    }
}
